import React from "react";
import ButtonLogoAnel from "../buttons/anel";
import ButtonTrird from "../buttons/button3";
import { Button, ButtonContainer, HeaderContainer } from "./styles";

// https://youtu.be/AXKc4WhgLSA - criar header com typeScript

const Header: React.FC = () => {


  return (
<HeaderContainer>
  < ButtonLogoAnel />
  
  
  <ButtonContainer>  
    <ButtonTrird name="Top 10" placeholder="Top 10"/>
    <ButtonTrird name="Top 10" placeholder="Top 10"/>
    <ButtonTrird name="Consulta Mês" placeholder="sss"/>
    <ButtonTrird name="Add Aniversariante" placeholder="XXX"/>
  </ButtonContainer>  
</HeaderContainer>
  )
}

export default Header
